package main

import (
    "encoding/json"
    "fmt"
    "log"
    "net/http"
    "strconv"
    "time"

    "github.com/gorilla/mux"
)

type User struct {
    ID        int       \`json:"id"\`
    Name      string    \`json:"name"\`
    Email     string    \`json:"email"\`
    CreatedAt time.Time \`json:"created_at"\`
}

type UserService struct {
    users  map[int]*User
    nextID int
}

func NewUserService() *UserService {
    return &UserService{
        users:  make(map[int]*User),
        nextID: 1,
    }
}

/**
 * * @description 创建用户的HTTP处理函数
 * ? @param w - HTTP响应写入器
 * ? @param r - HTTP请求对象
 * ! @return void
 */
func (s *UserService) CreateUser(w http.ResponseWriter, r *http.Request) {
    var user User
    if err := json.NewDecoder(r.Body).Decode(&user); err != nil {
        http.Error(w, "Invalid JSON", http.StatusBadRequest)
        return
    }

    user.ID = s.nextID
    user.CreatedAt = time.Now()
    s.users[user.ID] = &user
    s.nextID++

    w.Header().Set("Content-Type", "application/json")
    json.NewEncoder(w).Encode(user)
}

/**
 * * @description 获取所有用户的HTTP处理函数
 * ? @param w - HTTP响应写入器
 * ? @param r - HTTP请求对象
 * ! @return void
 */
func (s *UserService) GetUsers(w http.ResponseWriter, r *http.Request) {
    users := make([]*User, 0, len(s.users))
    for _, user := range s.users {
        users = append(users, user)
    }

    w.Header().Set("Content-Type", "application/json")
    json.NewEncoder(w).Encode(users)
}

func main() {
    service := NewUserService()

    r := mux.NewRouter()
    r.HandleFunc("/users", service.CreateUser).Methods("POST")
    r.HandleFunc("/users", service.GetUsers).Methods("GET")

    fmt.Println("服务器启动在 :8080")
    log.Fatal(http.ListenAndServe(":8080", r))
}

